{ if ::rand::random() { left } else { right }
} And the whole question will be about what should we put instead of each '_??. Let's try elision? For starters, let's try the typical works-way-more-often-than-it-deserves do-no-overcomplicate approach of using elided lifetimes everywhere: fn pick(left: &'_ str, right: &'_ str) -> &'_ str ‚ùå this fails because I wanted to make your life miserable the lifetime elision rules do not handle this situation: the inputs are so symmetric there is no clear "borrowee" argument. üëâ lifetime elision rules üëà Let's try repeating Now we could also try using distinct lifetime parameters for all three, but that will "never" work: we return a borrowing thing, so it has to be borrowing from at least one of the arguments, thus, in practice, a borrowing return type almost always has to involve a lifetime parameter that appears among one of the input types . Given how symmetric our code is, the sensible thing to do now would be to repeat all the lifetimes: fn pick<'ret>(s1: &'ret str, s2: &'ret str) -> &'ret str And this does: compile ‚úÖ not result in unnecesarily restrictive API ‚úÖ Yay! ü•≥ Aside: beginners often forget about the latter. Massaging a signature so that it becomes compatible with a given implementation often means we are making that function less compatible with certain call-site situations. While it can often be an acceptable loss, or a necessary one, other times that initial cargo check passing can hide that the API has become near-uncallable. That's why it is advisable to do this massaging of a function signature dance with an example usage / unit test next to it, so as to see the "two sides" of the caller/callee situation.

